import React from "react";
import CourseActive from "./components-sm/CourseActive";
import Welcome from "./components-sm/Welcome";
import Recommended from "./components-sm/Recommended";
import axios from "axios";

const Dashboard = () => {

    const fetchUserData = async (e) => {

        try {
            const res = await axios.post('/login');

            const data = res.data.msg;
            if (res.status === 401) {
                window.alert("unAuthorized access attempt!");
                console.log(data);
            }
        } catch (error) {
            window.alert("Some bad happend!")
            console.log(error.response.data);
        }
    }

    return (<>
        <Welcome />
        <CourseActive />
        <Recommended />
        fetchUserData();
    </>);
}

export default Dashboard;
